from meta_ai_api import MetaAI
import streamlit as st
from speech import speech_to_text
from txt_to_spch import text_to_speech

# function to laod OpenAI model
def get_openai_response(question):
    ai = MetaAI()
    try:
        promt = f"You are Customer Support Executive at a tech company. A customer has reached out to you with the following question: {question} Please provide a response to the customer. Limit your response to 280 characters."
        response = ai.prompt(
        message=f"{promt}"
        )
        output = response['message']
        print("output:",output)
        return output
    except Exception as e:
        raise e
 
    
## intialise streamlit app
st.set_page_config(page_title="Q&A")

st.header("Customer Support Chatbot")

input = st.text_input("Ask me anything:",key="input")
# response=get_openai_response(input)

## button
submit=st.button("Ask the question")
record = st.button("Record Audio")

# Display the image at the bottom right
st.markdown(
    """
    <style>
    .footer {
        position: fixed;
        bottom: 0;
        right: 0;
        width: 200px; /* Adjust the width as needed */
    }
    </style>
    <div class="footer">
        <img src="data:image/png;base64," width="200">
    </div>
    """,
    unsafe_allow_html=True

)

## button click
if submit:
    response = get_openai_response(input)
    st.subheader("The response is")
    st.write(response)

if record:
    text = speech_to_text()
    st.subheader("User")
    st.write(text)
    # get response from model
    response = get_openai_response(text)
    
    st.subheader("Agent")
    st.write(response)
    text_to_speech(response)
